import React from "react";

const SingleEvent = ({ event }) => {
  return (
    <div className="singleEvent">
      <img src={event.images[0].img1} alt="" style={{ width: "100%" }} />
      <h2>{event.name}</h2>
      <p>{event.description}</p>
    </div>
  );
};

export default SingleEvent;
